import { Card } from "react-bootstrap";
const Learning = () => {
  return (
    <ul className="people">
      <li className="d-flex mt-3">
        <div className="card-imgs">
          <Card.Img
            src="https://aftjdigital.com/wp-content/uploads/2020/07/social-media-marketing-goals.png"
            alt="user"
          />
        </div>
        <div className="card-person ml-3">
          <Card.Title>Social Media Marketing</Card.Title>
          <Card.Subtitle className="text-left">145.722 viewers</Card.Subtitle>
        </div>
      </li>
    </ul>
  );
};

export default Learning;
